Ext.data.JsonP['ACS_2013_28_March_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>ACS 2013 28 March Release Note</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p>\n\t\t</div>\n        <div class=\"header\"/>\n\n        <div id=\"src-50725358\" class=\"content\">\n                        <h1>ACS 2013 28 March Release Note</h1>\n    <p>This update included a number of bug fixes and scalability improvements. Notable fixes include:    </p>\n<ul class=\" \"><li class=\" \">    <p>Fixed an error that occurred when trying to create an event with the <tt class=\" \">recurring</tt> field set    </p>\n</li><li class=\" \">    <p>Fixed an issue that prevented editing of custom fields using the ACS web site    </p>\n</li><li class=\" \">    <p>Fixed an issue that prevented tags from being deleted using the ACS web site    </p>\n</li></ul>        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=50725358\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"ACS 2013 28 March Release Note"});